import { Routes, Route } from 'react-router-dom'
//import './App.css';

import Login from './pages/login/login'
import Default from './layout/default';

function App() {
  return (
    <div>
      <Routes>
        <Route path='/' element={<Default />} />
        <Route path='/login' element={<Login />} />
      </Routes>
    </div>
  );
}

export default App;
